import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import WillitendService from '../services/Willitend.service.js';
import React, { useState ,useEffect} from 'react';
import { makeStyles } from '@material-ui/core/styles';
const useStyles = makeStyles({
  table: {
    width: '100%',
    display: 'grid', 
    justifyContent: 'center', 
    alignItems: 'center',
  }
});
const map = {
  "Alabama": "AL",
  "Alaska" : "AK",
  "American Samoa" : "AS",
  "Arizona" : "AZ",
  "Arkansas" : "AR",
  "Armed Forces Americas" : "AA",
  "Armed Forces Europe" : "AE",
  "Armed Forces Pacific" : "AP",
  "California" : "CA",
  "Colorado" : "CO",
  "Connecticut" : "CT",
  "Delaware" : "DE",
  "District Of Columbia" : "DC",
  "Florida" : "FL",
  "Georgia" : "GA",
  "Guam" : "GU",
  "Hawaii" : "HI",
  "Idaho" : "ID",
  "Illinois" : "IL",
  "Indiana" : "IN",
  "Iowa" : "IA",
  "Kansas" : "KS",
  "Kentucky" : "KY",
  "Louisiana" : "LA",
  "Maine" : "ME",
  "Marshall Islands" : "MH",
  "Maryland" : "MD",
  "Massachusetts" : "MA",
  "Michigan" : "MI",
  "Minnesota" : "MN",
  "Mississippi" : "MS",
  "Missouri" : "MO",
  "Montana" : "MT",
  "Nebraska" : "NE",
  "Nevada" : "NV",
  "New Hampshire" : "NH",
  "New Jersey" : "NJ",
  "New Mexico" : "NM",
  "New York" : "NY",
  "North Carolina" : "NC",
  "North Dakota" : "ND",
  "Northern Mariana Islands" : "NP",
  "Ohio" : "OH",
  "Oklahoma" : "OK",
  "Oregon" : "OR",
  "Pennsylvania" : "PA",
  "Puerto Rico" : "PR",
  "Rhode Island" : "RI",
  "South Carolina" : "SC",
  "South Dakota" : "SD",
  "Tennessee" : "TN",
  "Texas" : "TX",
  "US Virgin Islands" : "VI",
  "Utah" : "UT",
  "Vermont" : "VT",
  "Virginia" : "VA",
  "Washington" : "WA",
  "West Virginia" : "WV",
  "Wisconsin" : "WI",
  "Wyoming" : "WY"
}


export default function Textfield (props) {
  const classes = useStyles();
  const state = props.place; 
  const statesData = props.statesData;
  const [stateInfo, setStatInfo] = useState([]);
  var is_load_failed = false;
  useEffect(() => {
    WillitendService.getAllStateInfo()
    .then(return_data =>{
    setStatInfo(return_data.data)
    })
    .catch(err=>{
      alert(err);
      is_load_failed = true;
      console.log("Unable to Loaded");
      }
    );
    console.log("State Data has been loaded!");
  }, []);
const rows = createData(state);
function createData(state) {
  if(!is_load_failed || state===""){
    var temp_result =[
      ["Days to Herd Immunity","N/A"],
      ["Vaccinations Per Day","N/A"],
      ["Citizens Currently Vaccinated (Fully)","N/A"],
      ["Citizens Currently Vaccinated (Partially)","N/A"]
    ]
    return temp_result;
  }
}

  return (
    <TableContainer component = {Paper}>
      <Table className={classes.table} aria-label="COVID-19 Vaccine Results Table">
        <TableHead>
        {state !== "" && 
          <h4>Vaccine Results for {state}</h4>
        }
        {state === "" &&
          <h3>Vaccine Results</h3>
        }
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row[0]}>
              <TableCell component="th" scope="row">
                {row[1]}
              </TableCell>
              <TableCell align="right">{row.result}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
